// InspectionDashboard.jsx
import InspectionCard from './IncidentsInvestigationForm';

const inspections = [
  { title: 'Electrical Inspection', formPath: '/form/electrical' },
  { title: 'Fire Safety', formPath: '/form/fire' },
  { title: 'Structural Review', formPath: '/form/structural' },
  { title: 'HVAC Systems', formPath: '/form/hvac' },
  { title: 'Water Damage', formPath: '/form/water' },
  { title: 'Emergency Exit', formPath: '/form/emergency' },
  { title: 'General Safety', formPath: '/form/general' },
];

function InspectionDashboard() {
  return (
    <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 p-4">
      {inspections.map((item, index) => (
        <InspectionCard key={index} title={item.title} formPath={item.formPath} />
      ))}
    </div>
  );
}

export default InspectionDashboard;
